import React from "react";

const PayloadsItems = (props) => {
  return (
    <div>
      <div class="card bg-dark" style={{ width: "20rem",marginTop: "10px"}}>
        <div class="card-body">
          <h5 class="card-title">Type : {props.name}</h5>
          <h6 class="card-subtitle mb-2 text-muted">{props.type}</h6>
          <p class="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>
        </div>
      </div>
    </div>
  );
};

export default PayloadsItems;
